import React from 'react'

const startgame = () => {
  return (
    <div>
      <div className='dices'>
        <img src="/images/dices.png" alt="dices" />
      </div>
      <div className='intro'>
        <h1>Dice Game</h1>
        <button>Play Now</button>
      </div>
    </div>
  )
}

export default startgame;
